// frontend/src/pages/profile.jsx
import React, { useEffect, useState } from "react";
import { getProfile, saveProfile } from "../api";
import { useNavigate } from "react-router-dom";

export default function Profile() {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    location: "",
    work_mode: "",
    role: "",
    domain: "",
    experience: "",
    visa_sponsorship: false,
  });
  const [msg, setMsg] = useState("");

  useEffect(() => {
    async function load() {
      try {
        const p = await getProfile();
        if (p && typeof p === "object") {
          // map backend field names if different
          setForm({
            location: p.location || "",
            work_mode: p.work_mode || p.work_mode || "",
            role: p.role || "",
            domain: p.domain || "",
            experience: p.experience || "",
            visa_sponsorship: p.visa_sponsorship || false,
          });
        }
      } catch (err) {
        // ignore, user may have no profile yet
      }
    }
    load();
  }, []);

  function handleChange(e) {
    const { name, value, type, checked } = e.target;
    setForm((prev) => ({ ...prev, [name]: type === "checkbox" ? checked : value }));
  }

  async function handleSave() {
    try {
      await saveProfile({
        location: form.location,
        work_mode: form.work_mode,
        role: form.role,
        domain: form.domain,
        experience: form.experience ? Number(form.experience) : null,
        visa_sponsorship: !!form.visa_sponsorship,
      });
      setMsg("Saved!");
      // after save, go back to dashboard
      setTimeout(() => navigate("/dashboard"), 800);
    } catch (err) {
      setMsg("Save failed");
    }
  }

  return (
    <div className="container">
      <h2>Your Job Preferences</h2>

      <div style={{ marginTop: 8 }}>
        <label>Location</label><br />
        <input name="location" value={form.location} onChange={handleChange} />
      </div>

      <div style={{ marginTop: 8 }}>
        <label>Work Mode (Remote/Hybrid/On-site)</label><br />
        <input name="work_mode" value={form.work_mode} onChange={handleChange} />
      </div>

      <div style={{ marginTop: 8 }}>
        <label>Role</label><br />
        <input name="role" value={form.role} onChange={handleChange} />
      </div>

      <div style={{ marginTop: 8 }}>
        <label>Domain</label><br />
        <input name="domain" value={form.domain} onChange={handleChange} />
      </div>

      <div style={{ marginTop: 8 }}>
        <label>Experience (years)</label><br />
        <input name="experience" type="number" value={form.experience} onChange={handleChange} />
      </div>

      <div style={{ marginTop: 8 }}>
        <label>
          <input
            type="checkbox"
            name="visa_sponsorship"
            checked={!!form.visa_sponsorship}
            onChange={handleChange}
          />
          Need Visa Sponsorship
        </label>
      </div>

      <div style={{ marginTop: 12 }}>
        <button onClick={handleSave}>Save profile</button>
        <button onClick={() => navigate("/dashboard")} style={{ marginLeft: 8 }}>
          Back to Dashboard
        </button>
      </div>

      {msg && <p>{msg}</p>}
    </div>
  );
}
